The testimonies given by Larry Butz indicate that he was present on the lake during the night of the incident. In Testimony 3, Butz claims to have heard a single "bang" while on the lake. However, the evidence from Lotta Hart's deposition (Evidence 11) contradicts this testimony. Lotta states that she heard two sounds like gunshots just after midnight on 12/25, suggesting that two gunshots were fired, not just one.

Thus, there is a contradiction between what Larry heard (Testimony 3: a single "bang") and what Lotta reported (Evidence 11: two gunshots).

