The testimonies provided by Ini describe an encounter with her deceased sister, Mimi. Ini claims not to have been scared and mentions Mimi's costume looking "totally normal." However, this contradicts with the known fact that Maya Fey was channeling at the time, wearing the robes of a spirit medium. If Mimi appeared as Ini described, she wouldn't be seen in 'normal' attire but rather in the robes typical of a spirit medium, as seen when channeled by Maya. Furthermore, according to Maya's Magatama evidence, there’s a deep, profound aura associated with channelling, indicating that a supposed encounter with a ghost should evoke a different reaction. Hence, this juxtaposition raises doubts regarding the authenticity of Ini's claims. 

