Moe's testimony claims that the shadow he saw could only have belonged to Max, mentioning the distinct characteristics of Max's appearance such as his silk hat and cloak (Testimony 3). Moe claims that despite the shadow obscuring the individual's face, Moe was certain it was Max.

However, the Crime Photo (Evidence 2) shows footprints in the snow leading up to the victim where the shadow was seen. If Max was indeed the culprit, Moe's testimony should reference the footprints that belong to Max. This inconsistency suggests the testimony may not be accurate if the footprints do not align with Max’s footwear or if Moe's identification is based solely on seeing a silhouette with Max's symbols rather than seeing Max himself, especially since it would be difficult to discern facial features when the face is obscured in silhouette, as Moe claims in Testimony 3.

